import React from "react";
import Box4 from '../components/BoxBetsContainer';
import { Container } from "react-bootstrap";
import NavBar from '../components/NavBar';
import Footer from '../components/Footer';

const Members = () => {
  return (
  <>
  <NavBar/>
    <Container fluid>
          <Box4 />
    </Container>
  <Footer/>
  </>
  );
};

export default Members;
